                    <div key={index}>
                        <p className="news__idNote">{item.idNote}:</p>
                        <p className="news__text">{item.textNote}</p>
                    </div>)
            });
        }*/

    render() {

        const fx = () => {
            return <div>Всем привет, я компонент fx</div>
        }

        return (
            <div>
                <fx/>
                <p> Местопо j j ложеие: {this.props.notes}</p>


            </div>
        );
    }


}

export default Results;
